import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import Home from './pages/Home'
import './App.css'
import Cadastro from './pages/cadastro'



function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={ <Home /> } exact />
      </Routes>
    </Router>
  )
}

export default App;
